import React, { useState } from 'react'
import { Text, View, StyleSheet, ImageBackground,Image,TouchableOpacity, Switch ,TextInput,SafeAreaView  } from "react-native"
import * as Animatable from 'react-native-animatable';
import firebase from 'firebase/app';
import "firebase/auth";


const UselessTextInput = () => {
  const [text, onChangeText] = React.useState("Useless Text");
  const [number, onChangeNumber] = React.useState(null);

 
  return (
    function replica(){
    
    
        <Text>
            {number}
        </Text>;
     
     
       },
     



    <View>
        <Text style={styles.text}>PISOS</Text>
      <TextInput
        style={styles.input}
        onChangeText={onChangeNumber}
        value={number}
        placeholder="Ingrese numero"
        keyboardType="numeric"
      />
      <TouchableOpacity  onPress={() => replica()}>
          <Text style={styles.enter}>Enter</Text>

      </TouchableOpacity>
    
    </View>
    
     

    

  );
};

const styles = StyleSheet.create({
  text: {
    top:"100%",  
    height: 40,
    margin: 12,
    
    padding: 10,
  },
  input: {
    top:"105%",  
    height: 40,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },

  enter:{
    top:"290%",  
    height: 40,
    width:80,
    borderRadius:10,
    margin: 12,
    borderWidth: 1,
    padding: 10,
    backgroundColor:"blue",
    


  }
});

export default UselessTextInput;
